import React from "react";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import { FirstName, LastName } from "./App";

const CompC = () => {
  return (
    <>
      <FirstName.Consumer>
        {(fname) => {
          return(
            <LastName.Consumer>{(lname)=>{
                return  <h1>My name {fname}</h1>;
            }}</LastName.Consumer>
          )
          
          
        }}
      </FirstName.Consumer>
    </>
  );
};

export default CompC;
